import { Routes, Route } from "react-router-dom";
import pages from "./pages";
import SharedLayout from "./components/SharedLayout/SharedLayout";
import NotFound from "./pages/NotFound";

function App() {
  return (
    <div>
      <Routes>
        <Route path="/" element={<SharedLayout />}>
          <Route path="/digitalization" element={pages.Digitalization} />
          <Route path="/infrastructure" element={pages.Infrastructure} />
          <Route path="/healthcare" element={pages.Healthcare} />
          <Route path="/education" element={pages.Education} />
          <Route path="/economy" element={pages.Economy} />
          <Route path="*" element={<NotFound />} />
        </Route>
      </Routes>
    </div>
  );
}

export default App;
